INSERT INTO `items` VALUES (1,'Poly-Overpack® 600','0.00',1,1,'1051-YE','A Huge 600-Gallon Capacity.','<p>\r\n	Designed specifically for the storage and transport of large transformers, the Poly-Overpack 600 offers an easy, cost-effective way to keep hazardous fluids under control.</p>\r\n','225 lbs. / 102 kg.','5000 lbs. / 2268 kg.','600 gal. /  2271 L','','','','Drum','EPA 40 CFR 761.65, SPCC, NPDES','2011-02-18 19:16:30','2011-04-25 12:19:43',5);
INSERT INTO `items` VALUES (2,'Poly-Overpack® 65 Salvage Drum','0.00',1,1,'1065-YE','Just The Right Size For 30-Gallon Drums.','Our Poly-Overpack 65 meets\r\nGroup 1 packaging standards, Salvage Drum regulations, and is designed to fit 30-gallon drums.\r\nThis overpack nests for easy storage and has a gasket lid for secure containment.\r\n\r\nNo wasted space! No wasted money!\r\n\r\nGreat As A Spill Kit Container!\r\nIt’s light enough for one person to handle and large enough to pack sufficient absorbent and response equipment for incidental spills.','46.7 lbs. / 21.8 kg.','440 lbs. / 200 kg.','65 gal. / 246 L','','','','Drum','EPA 40 CFR 264.175, SPCC, NPDES','2011-02-18 19:16:31','2011-04-24 11:21:01',6);
INSERT INTO `items` VALUES (3,'Poly-Overpack® 180T Overpack Drum','0.00',1,1,'1180-YE','Ideal for utilities in transport and storing transformers.','The Poly-Overpack 180T offers a large, 180-gallon capacity to handle the big jobs, while it\'s tight grip feature saves time and money.','116 lbs. / 53 kg.','2500 lbs. / 1134 kg.','180 gal. / 681.4 L','','','','Drum','EPA 40 CFR 264.175, SPCC, NPDES','2011-02-18 19:16:31','2011-04-24 11:21:00',4);
INSERT INTO `items` VALUES (4,'Poly-Overpack® 20 Salvage Drum','0.00',1,1,'1220-YE','Big Features And Big Savings!','<iframe title=\"YouTube video player\" width=\"360\" height=\"300\" src=\"http://www.youtube.com/embed/6Qyo5aIC84E?rel=0\" frameborder=\"0\" allowfullscreen></iframe>\r\n\r\nThe new 20-gallon Salvage Drum is a versatile unit that can directly contain solids and sludges with security. With a 1/2 turn lid, these ergonomically designed units allow for easy access, unlike competing “hoop-ring designs.” The 20-gallon Salvage Drum accepts bottles, cans and 5-gallon pails. Units are also nestable, which allows for ease of shipment. Save on shipping cost and storage space!','10.4 lbs. / 4.7 kg.','166 lbs. / 75 kg.','20 gal. / 75.7 L','','','','Drum','UN 1H2/X75/S\r\nUN 1H2/Y100/S\r\nDOT 49 CFR 173.3 (c),\r\nEPA, SPCC and NPDES','2011-02-18 19:16:31','2011-04-24 11:21:57',143);
INSERT INTO `items` VALUES (5,'Poly-Overpack® 30 Salvage Drum','0.00',1,1,'1230-YE','Big Features And Big Savings!','<iframe title=\"YouTube video player\" width=\"360\" height=\"300\" src=\"https://www.youtube.com/embed/BR41e1CM8Jk?rel=0\" frameborder=\"0\" allowfullscreen></iframe>\r\n\r\nThe new 30-gallon Salvage Drum is a versatile unit that can directly contain solids and sludges with security. With a 1/2 turn lid, these ergonomically designed units allow for easy access, unlike competing “hoop-ring designs.” This 30-gallon Salvage Drum can contain up to 16-gallon drums. Units are also nestable, which allows for ease of shipment. Save on shipping cost and storage space!','12.9 lbs. / 5.9 kg.','220 lbs. / 100 kg.','30 gal. / 113.5 L','','','','Drum','UN 1H2/X75/S\r\nUN 1H2/Y100/S\r\nDOT 49 CFR 173.3 (c),\r\nEPA, SPCC and NPDES','2011-02-18 19:16:31','2011-04-24 11:21:57',142);
INSERT INTO `items` VALUES (6,'Poly-Overpack® 95 Salvage Drum','0.00',1,1,'1237-YE',' Is Your Overpack Really A Salvage Drum?','Our Poly-Overpack 95 meets Group 1 packaging standards and salvage drum regulations (unlike competitive overpacks). The Poly-Overpack 95 safely contains a wide range of hazardous materials including: acids, corrosives and damaged parts - in 55-gallon drums.\r\n\r\nTight, secure and leak-free container closing is simple: place any long object (like a wooden two-by-four) in the handy lid slots, and turn to screw the lid down tightly.\r\n\r\nMeets performance-oriented packaging requirements of U.S. DOT and UN regulations.','48.2 lbs. / 21.9 kg.','650 lbs. / 295 kg.','95 gal. / 359.6 L','','','','Drum','UN 1H2/X295/S,\r\nUN 1H2T/Y295/S,\r\nDOT 49 CFR 173.3','2011-02-18 19:16:31','2011-04-24 11:21:00',1);
INSERT INTO `items` VALUES (7,'Poly-Overpack® 110 Salvage Drum','0.00',1,1,'1240-YE','Ideal For Distorted Or Bowed Drums.  ','<iframe title=\"YouTube video player\" width=\"360\" height=\"300\" src=\"http://www.youtube.com/embed/Bu6Q1v8HrEA?rel=0\" frameborder=\"0\" allowfullscreen></iframe>\r\n\r\nContaining irregular drums is not a problem with this handy-size overpack. All the great performance features of the Poly-Overpack 95, but built taller to handle those misshapen drums.','51.3 lbs. / 23.3 kg.','650 lbs. / 295 kg.','103 gal. / 390 L','','','','Drum','UN 1H2/X295/S,\r\nDOT 49 CFR 173.3(c),\r\nEPA, SPCC and NPDES','2011-02-18 19:16:31','2011-04-24 11:21:01',8);
INSERT INTO `items` VALUES (8,'Wheeled Overpack® 50 Salvage Drum','0.00',1,1,'1259-YE','Wheeled Overpack® 50 Salvage Drum','ENPAC’s Wheeled Overpacks® are the first mobile one-piece overpack on wheels. A Salvage Drum and dolly in one! They completely eliminate the need for a separate dolly transportation. The 50-gallon polyethylene UN rated Salvage Drums have built-in handles and 6” Polyolefin wheels that allow for easy steering through doorways and around any obstacle. Ideal for mobile Spill Kits.','46.8 lbs. / 21.2 kg.','275 lbs. / 125 kg.','50 gal. / 189.3 L','','','','Drum','UN 1H2/X125/S,\r\nDOT 49 CFR 173.3(c),\r\nEPA, SPCC and NPDES','2011-02-18 19:16:31','2011-04-24 11:21:01',9);
INSERT INTO `items` VALUES (9,'Envirosalv™ Locking 95 Gallon Spill Kit','0.00',1,1,'1295-LK','Envirosalv™ Locking 95 Gallon Spill Kit','One of our most innovative design improvements for 2010 is the Lock Down Security Kit - which locks and secures the 1295-YE drum to its destination. Lock Down Kit (1295-LK) is available as an optional - lockable, serialized, identification security system when accountability matters most. Lock Down Kit adds an identification feature to account for hazardous material from point A to Z.','1 lbs. / .45 kg.','','','','','','Standard','','2011-02-18 19:16:31','2011-05-19 16:47:49',10);
INSERT INTO `items` VALUES (10,'Envirosalv™ Poly Salvage Drum Plus','0.00',1,1,'1295-YE','Envirosalv™ Poly Salvage Drum Plus','THE “LOCKING” OVERPACK SALVAGE DRUM OF THE FUTURE! ENPAC® has done it again! With years of research and development, ENPAC® introduces ENVIROSALV™ Poly-Salvage Drum Plus; an extension to ENPAC’s®global legacy of Salvage Drums. The ENVIROSALV line brings many new features and benefits to the Salvage Drum world. The ENVIROSALVTM safely contains a wide range of hazardous materials including: acids, corrosives and damaged drums. Our most innovative design improvement is the Lock Down Security Kit - which locks and secures the drums safely to it’s destination.\r\n\r\nPatent: US 2010/0288667','56 lbs. / 25.4 kg.','650 lbs. / 295 kg.','95 gal. / 359.6 L','','','','Drum','UN 1H2/X75/S\r\nUN 1H2/Y100/S\r\nDOT 49 CFR 173.3 (c),\r\nEPA, SPCC and NPDES','2011-02-18 19:16:31','2011-04-24 11:21:00',3);
INSERT INTO `items` VALUES (11,'Wheeled Overpack® 95 Salvage Drum','0.00',1,1,'1299-YE','Wheeled Overpack® 95 Salvage Drum','ENPAC’s Wheeled Overpacks® are the first mobile one-piece overpack on wheels that can handle 55-gallon drums. A Salvage Drum and dolly in one! They completely eliminate the need for a separate dolly transportation. The 50-gallon polyethylene UN rated Salvage Drums have built-in handles and 6” Polyolefin wheels that allow for easy steering through doorways and around any obstacle. Ideal for mobile Spill Kits.','57.7 lbs. / 26.2 kg.','250 lbs. / 113 kg.','95 gal. / 359.6 L','','','','Drum','UN 1H2/X125/S,\r\nDOT 49 CFR 173.3(c),\r\nEPA, SPCC and NPDES','2011-02-18 19:16:31','2011-04-24 11:21:00',2);
INSERT INTO `items` VALUES (12,'Fast Pack™ Spill Kit - Universal','0.00',1,1,'1300-YE','Fast Pack™ Spill Kit Universal','This compact and portable vehicle response kit is for your most small transportation spills, held in a yellow water-resistant nylon bag. A single heavy-duty strap provides convenient transport and response. These packs are especially great for fueling locations! Refills available for all Spill Kits. Now available in Woodland and Desert Camo.\r\n\r\nAbsorbs up to 5 gallons/19 liters\r\n\r\nSpill Kit includes:\r\nHeavy duty duffel,\r\n10 Pads,\r\n2 - Small Socks,\r\n1 Disposal Bag and Tie\r\nAlso contains baggie with:\r\n1 pr Nitrile Gloves,\r\n8 oz. STARDUST,\r\nEmergency Response Guide,\r\nInstruction Sheet and MSDS(s).','','','','','','','Standard','EPA, SPCC, NPDES','2011-02-18 19:16:31','2011-05-19 16:47:49',7);
