INSERT INTO `items` VALUES (18,'Fast Pack Trauma-Sorb® Spill Kit','0.00',1,1,'1314-RD','Trauma-Sorb® Fast Pack Spill Kit','Compact and portable, Trauma-Sorb® heavyweight Kit includes:\r\n\r\n1 - Fast Pack Heavy-duty Zipped Duffel \r\n6 - Flat Socks\r\n10 - HW Pads\r\n25 - Wipers\r\n1- Disposal Bags w/Tie\r\n1 - Pair Nitrile Gloves\r\n1 - Pair Goggles, and MSDS(s). \r\n\r\nAbsorbent kits protect medical\r\nequipment, staff, and the\r\nenvironment in emergency \r\nesponse conditions.   Provides\r\nabsorption protection for saline,\r\nsterilants, blood and other body\r\nfluids. Convenient nylon handles\r\nand straps provide easy transport\r\nand response. Refills available. Trauma-Sorb® used by permission. \r\nUS patent # 5476456','','','','','','','Standard','','2011-02-18 19:16:32','2011-05-19 16:47:52',14);
