INSERT INTO `items` VALUES (32,'Round - Trash, Sediment & Debris','0.00',1,1,'1340','Adjustable Catch Basin Insert','The Storm Sentinel Drain Protection Inserts help companies comply with Stormwater Pollution Prevention Plans and Stormwater Best Management Practices by protecting your storm drains and catch basins. It is the sure way to catch oil and sediment headed into storm drains and sewers. Equipped with an oil-absorbent media in a screened bag, the Storm Sentinel guards against any potential discharge.\r\n\r\nENPAC’s enhanced design has increased the surface area for greater sediment retention while decreasing the depth of the unit in the catch basin.\r\n \r\nInserts fit round catch basin’s from 27” to 29” in diameter. Custom sizes available.\r\n\r\nUp to 500 GPM overflow rate helps avoid ponding. Requires no special tools to install. Helps comply with NPDES, 40 CFR 122.26 when used as Best Management Practice in Storm Water Pollution Prevention Plans.\r\n\r\nTO INSTALL: Remove grate and adjust wire frame to fit in recess. Place insert into recess and frame into corners. Replace metal grate.\r\n\r\nTO REMOVE: Lift the grate, grab the handle and pull out the insert. No part of the insert extends above the surface.','2 lbs. / .9 kg.','','','','','','Standard','EPA, SPCC, NPDES','2011-02-18 19:16:32','2011-05-19 16:47:52',16);
INSERT INTO `items` VALUES (33,'Round - Trash & Debris','0.00',1,1,'1340-TD','Adjustable Catch Basin Insert','The Storm Sentinel Drain Protection Inserts help companies comply with Stormwater Pollution Prevention Plans and Stormwater Best Management Practices by protecting your storm drains and catch basins. It is the sure way to catch oil and sediment headed into storm drains and sewers. Equipped with an oil-absorbent media in a screened bag, the Storm Sentinel guards against any potential discharge.\r\n\r\nENPAC’s enhanced design has increased the surface area for greater sediment retention while decreasing the depth of the unit in the catch basin.\r\n \r\nInserts fit round catch basin’s from 27” to 29” in diameter. Custom sizes available.\r\n\r\nUp to 500 GPM overflow rate helps avoid ponding. Requires no special tools to install. Helps comply with NPDES, 40 CFR 122.26 when used as Best Management Practice in Storm Water Pollution Prevention Plans.\r\n\r\nTO INSTALL: Remove grate and adjust wire frame to fit in recess. Place insert into recess and frame into corners. Replace metal grate.\r\n\r\nTO REMOVE: Lift the grate, grab the handle and pull out the insert. No part of the insert extends above the surface.','2 lbs. / .9 kg.','','','','','','Standard','EPA, SPCC, NPDES','2011-02-18 19:16:33','2011-05-19 16:47:52',16);
INSERT INTO `items` VALUES (34,'Large Rectangular - Trash, Sediment & Debris','0.00',1,1,'1341-TD','Adjustable Catch Basin Insert','The Storm Sentinel Drain Protection Inserts help companies comply with Stormwater Pollution Prevention Plans and Stormwater Best Management Practices by protecting your storm drains and catch basins. It is the sure way to catch oil and sediment headed into storm drains and sewers. Equipped with an oil-absorbent media in a screened bag, the Storm Sentinel guards against any potential discharge.\r\n\r\nENPAC’s enhanced design has increased the surface area for greater sediment retention while decreasing the depth of the unit in the catch basin.\r\n\r\nLarge Rectangle inserts fit catch basin’s from 16\"x20\" to 28\"x36\" (41cm x 51cm to 71cm x 97cm). Custom sizes available.\r\n\r\nUp to 500 GPM overflow rate helps avoid ponding. Requires no special tools to install. Helps comply with NPDES, 40 CFR 122.26 when used as Best Management Practice in Storm Water Pollution Prevention Plans.\r\n\r\nTO INSTALL: Remove grate and adjust wire frame to fit in recess. Place insert into recess and frame into corners. Replace metal grate.\r\n\r\nTO REMOVE: Lift the grate, grab the handle and pull out the insert. No part of the insert extends above the surface.','2 lbs. / .9 kg.','','','','','','Standard','EPA, SPCC, NPDES','2011-02-18 19:16:33','2011-05-19 16:47:52',18);
INSERT INTO `items` VALUES (36,'Storm Sentinel Adjustable Catch Basin Insert™ X-Large Rectangular','0.00',1,1,'1341-TD-XL','Adjustable Catch Basin Insert','<p>\r\n	The Storm Sentinel Drain Protection Inserts help companies comply with Stormwater Pollution Prevention Plans and Stormwater Best Management Practices by protecting your storm drains and catch basins. It is the sure way to catch oil and sediment headed into storm drains and sewers. Equipped with an oil-absorbent media in a screened bag, the Storm Sentinel guards against any potential discharge. ENPAC&rsquo;s enhanced design has increased the surface area for greater sediment retention while decreasing the depth of the unit in the catch basin. 1341 &amp; 1344 fit any size rectangular catch basin&rsquo;s from 16&rdquo;x20&rdquo; to 28&rdquo;x36&rdquo;. XL version fits rectangular catch basin&rsquo;s up to 42&rdquo;x42&rdquo;. 1340 &amp; 1343 fit any size round catch basin&rsquo;s from 27&rdquo; to 29&rdquo; in diameter. Custom sizes available. Up to 500 GPM overflow rate helps avoid ponding. Requires no special tools to install. Helps comply with NPDES, 40 CFR 122.26 when used as Best Management Practice in Storm Water Pollution Prevention Plans. TO INSTALL: Remove grate and adjust wire frame to fit in recess. Place insert into recess and frame into corners. Replace metal grate. TO REMOVE: Lift the grate, grab the handle and pull out the insert. No part of the insert extends above the surface.</p>\r\n','3 lbs. / 1.4 kg.','','','','','','Adjustable','EPA, SPCC, NPDES','2011-02-18 19:16:33','2011-04-25 13:36:08',17);
