INSERT INTO `items` VALUES (52,'50-Gallon-Wheeled-Spill-Kit-Universal','0.00',1,1,'1350-YE','50 Gallon Wheeled Spill Kit Universal','Did you know that the typical workplace lost time accident costs the employer an average of $30,000 per incident? ENPAC’s complete line of portable containment solves your need for immediate, reliable and portable spill containment to avoid those losses. But you can never anticipate spills. For that reason, you need a Spill Kit ready and mobile for the clean-up job ahead. \r\nThis first and only one-piece Wheeled Overpack Spill Kit is available in : Oil Only, Universal and Aggressive Liquids. It also contains our 50-gal UN rated salvage drum (UN/1H2/X125/s), holding various products to absorb up to 31 gallons of spilled substances!\r\n\r\n\r\nAbsorbs up to 31 gallons/117 liters\r\nSpill Kit includes:\r\n50 Gal. Wheeled Salvage Drum,\r\n40 Pads,\r\n5 - Large Socks, 10 - Small Socks,\r\n1 pack Wipers,\r\n1 Gallon Jub ENSORB,\r\n4 Disposal Bags and Ties,\r\n2 pr Nitrile Gloves,\r\n2 pr Goggles,\r\nEmergency Response Guide,\r\nInstruction Sheet and MSDS(s).','','275 lbs. / 125 kg.','','','','','Standard','EPA, SPCC, NPDES','2011-02-18 19:16:34','2011-05-19 16:47:50',23);
