INSERT INTO `items` VALUES (85,'ENPAC® Leak Repair Kit','0.00',1,1,'13-LRK','ENPAC® Leak Repair Kit','The ENPAC® Leak Repair Kit can be usedto plug leaking gasoline, diesel or biofueltanks to minimize the amount of fuel lostand the clean up required. Prevent waterdamage to freight by immediately plugginga damaged trailer that is allowing rainwater to get in. Plug either from theinside or the outside to keep the trailer in operation. Kit includes: Plug pattie,\r\nAluminum butyl tape, Super\r\nabsorbent pad and gloves','','','','','','','Standard','','2011-02-18 19:16:37','2011-05-19 16:47:52',32);
INSERT INTO `items` VALUES (86,'Econo™ Spill Pak - Oil Only','0.00',1,1,'13-SP2O','Econo™ Spill Pak Oil Only','Even the smallest package of ENPAC\'s finest products can go a long way. Perfect for stashing behind the seat of a truck or placing in a stuff box, the Econo™ Spill Pak couldn\'t be more convenient. This kit can be refilled but it’s so economical, we feel it’s disposable.\r\n\r\nAbsorbs up to 5 gallons/19 liters\r\n\r\nEach Kit Contains:\r\n1- Plastic “Budget Bag”\r\n12- Pads\r\n3- Socks\r\n1- Pair Nitrile Gloves\r\n1- Disposal Bag, Tie, & Instructions','','','','','','','Standard','EPA, SPCC, NPDES','2011-02-18 19:16:37','2011-05-19 16:47:50',31);
