INSERT INTO `items` VALUES (88,'Deluxe-Truck-Wall-Mount-Spill-Kit-Oil-Only','0.00',1,1,'13-TWSK-O','Deluxe-Truck-Wall-Mount-Spill-Kit™-Oil-Only','The Deluxe Long Haul Truck Spill Kit can be used as a truck-mounted carrier under semi-trucks/trailers or as a spill response unit in almost any location when mounted to the wall. Mounts easily to trailer undercarriage or walls utilizing molded/slotted holes for multiple mounting options. Contents are safely contained in the lockable ENPAC Poly-Edge which has a durable weather and water resistant gasket seal that keeps all stored items secure and dry. This Deluxe Kit also includes an ENPAC 100 gallon Prowler Pop-Up Pool for immediate spill containment to the widest range of chemicals and a complete Leak Repair Kit. \r\n\r\nThe Leak Repair Kit can be used to:\r\n\r\nPlug leaking gasoline\r\nStop leaking diesel or biofuel tanks\r\nPrevent rain damage in freight trailers','','','','','','','Standard','','2011-02-18 19:16:37','2011-05-19 16:47:50',34);
INSERT INTO `items` VALUES (89,'Deluxe-Long-Haul-Truck-Spill-Kit-Universal','0.00',1,1,'13-TWSK-U','Deluxe Long Haul Truck Spill Kit™ Universal','The Deluxe Long Haul Truck Spill Kit can be used as a truck-mounted carrier under semi-trucks/trailers or as a spill response unit in almost any location when mounted to the wall. Mounts easily to trailer undercarriage or walls utilizing molded/slotted holes for multiple mounting options. Contents are safely contained in the lockable ENPAC Poly-Edge which has a durable weather and water resistant gasket seal that keeps all stored items secure and dry. This Deluxe Kit also includes an ENPAC 100 gallon Prowler Pop-Up Pool for immediate spill containment to the widest range of chemicals and a complete Leak Repair Kit. \r\n\r\nThe Leak Repair Kit can be used to:\r\n\r\nPlug leaking gasoline\r\nStop leaking diesel or biofuel tanks\r\nPrevent rain damage in freight trailers','','','','','','','Standard','','2011-02-18 19:16:37','2011-05-19 16:47:50',34);
INSERT INTO `items` VALUES (90,'Large Totes','0.00',1,1,'1505-YE','Large Totes','ENPAC Totes are the only stackable,\r\nnestable, forkliftable, water resistant,\r\nmobile totes on the market.\r\nThe Large Tote offers a 500 lb. handling capacity.\r\n\r\n FDA Food Grade.\r\n\r\n ENPAC Totes make great Spill Kit containers!\r\n\r\nCombo includes:\r\n\r\nlid w/handles\r\n\r\n4” polyurethane wheels (Part #: 1510) or \r\n\r\n8” solid rubber wheels (Part #: 1511).\r\n\r\nWheel kits available separately:  Part #: 1515 (4\"), Part #: 1535 (8\").','51.2 lbs. / 23 kg.','500 lbs. / 227 kg.','123 gal. / 465.6 L','','','','Standard','','2011-02-18 19:16:38','2011-05-19 16:47:52',35);
