INSERT INTO `items` VALUES (94,'Poly-Edge™','0.00',1,1,'1601-BK','Multi-Functional Storage Unit Offers Transportable Convenience.','ThePoly-Edge can be used as a truck-mounted carrier spill response unit orwall-mounted unit in such applications as manufacturing facilities,laboratories and hospitals. The lockable, large capacity unit offersversatile storage for tools and absorbents as well as ENPAC’s StingerBerms and Prowler Pools.\r\n\r\nWill not rust or corrode.\r\nSlotted footprint makes mounting easy.\r\nConstructed of lightweight 100% polyethylene.\r\nA special weather and water-resistant gasket keeps stored items dry.','14 lbs. / 6 kg.','75 lbs. / 34 kg.','','','','','Standard','','2011-02-18 19:16:38','2011-04-24 11:21:13',30);
INSERT INTO `items` VALUES (95,'Poly-Safetypack','0.00',1,1,'2038-YE','Safe, Secure Two-Drum Storage.','This tough, indoor or outdoor\r\nperformer protects two 55-gallon\r\ndrums while containing leaks with\r\na 135-gallon sump capacity.\r\nDrum access and removal is easy\r\nwith our unique gull-wing covers.\r\nItems inside are protected from\r\nthe weather with our unique\r\nslide-over lid design. \r\n\r\nSecurity locks are included to\r\nsecure the covers and contents.\r\n100% polyethylene has excellent\r\nresistance to chemicals as well\r\nas weather. Translucent sidewalls\r\nallow for an immediate view of \r\nliquids so you won’t need  to open \r\nhe lids to see if there has been a leak.\r\nThe Poly-Safetypack is easily\r\nhandled by forklift or pallet jack\r\nfrom two sides. Optional drain.','103 lbs. / 46.7 kg.','1200 lbs. / 544 kg.','130 gal. / 492.1 L','','','','Cube','EPA 40 CFR 264.175, SPCC, NPDES, UFC','2011-02-18 19:16:38','2011-04-24 11:22:00',153);
INSERT INTO `items` VALUES (96,'Poly-Safetypack Plus','0.00',1,1,'2077-YE','Taller For Secure Pumping Stations.','Poly-Safetypack Plus provides the same results as the Poly-Safetypack with the key advantage of a 54.25” inside height. This feature allows the lids to be closed with the pumps in place to create a versatile pumping station. Convenience meets functionality with its larger 270 gallon capacity. Optional drain.\r\n\r\n','137 lbs. / 62 kg.','1200 lbs. / 544 kg.','264 gal. / 999.3 L','','','','Cube','EPA 40 CFR 264.175, SPCC, NPDES, UFC','2011-02-18 19:16:38','2011-04-24 11:21:14',37);
INSERT INTO `items` VALUES (97,'Universal Poly-Drum™ Funnel','0.00',1,1,'3004-YE','Universal Poly-Drum™ Funnel','Fits both closed-head and open-head 55-gallon drums, and other containers. Just set it and forget it. Exclusive features include patented scalloped design, high side wall, bung fitting holders and optional cover for added protection and value!\r\n','3 lbs. / 1.4 kg.','','','','','','Funnel','EPA, SPCC, NPDES','2011-02-18 19:16:38','2011-04-24 11:21:15',46);
INSERT INTO `items` VALUES (98,'Universal Poly-Drum™ Safety Funnel','0.00',1,1,'3004-YE-SF','Universal Poly-Drum™ Safety Funnel','All the same features as the\r\nUniversal Poly-Drum Funnel plus\r\na non-sparking safety bung closure with flame arrestor.\r\nIdeal for flammable liquids.\r\nOptional cover available. ','5 lbs. / 2.3 kg.','','','','','','Funnel','EPA, SPCC, NPDES','2011-02-18 19:16:38','2011-04-24 11:21:15',45);
INSERT INTO `items` VALUES (99,'Poly-Pail Funnel™','0.00',1,1,'3005-YE','Poly-Pail Funnel™','Mounts to 3.5-, 5-, and 6-gallon tight-head pails. Also fits open-top pails with 12” diameter. ','2 lbs. / 1 kg.','','','','','','Funnel','EPA, SPCC, NPDES','2011-02-18 19:16:38','2011-04-24 11:21:15',43);
