INSERT INTO `items` VALUES (102,'Poly-Drum Topper™','0.00',1,1,'3065-BK','Poly-Drum Topper™','Our Drum Topper snaps directly onto any 55-gallon open or closed-head drum to keep out debris and protect drum tops.','1.5 lbs. /  .7 kg.','','','','','','Funnel','','2011-02-18 19:16:38','2011-04-24 11:21:14',38);
INSERT INTO `items` VALUES (103,'Drum-Lifter','0.00',1,1,'3100-BU','Drum Lifter®','Salvage drum loading is one of the trickiest drum handling jobs. This lifter makes it easy! Unique slim design allows unit to be used where clearance is tight. Works great for general drum handling, too. Jaw has only one moving part, making the lifter practically maintenance free.\r\n\r\n• Lift open-head or tight-head pails and drums\r\n• Slim design for loading drums into salvage drums\r\n• 1,000 lb. capacity','22 lbs. / 9.9 kg.','1000 lbs. / 453.7 kg.','','','','','N/A','','2011-02-18 19:16:39','2011-05-04 17:05:05',140);
INSERT INTO `items` VALUES (104,'Drip Sentinel™ Drum Top Workstation™','0.00',1,1,'3200-BK','Pays For Itself With The First Drum Of Liquids Dispensed!','The Drip Sentinel Drum-Top Workstation from ENPAC helps save liquids that are routinely lost during the dispensing process by catching and redirecting them to the drum fresh and free of debris.\r\n\r\nThe Drip Sentinel Drum-Top Workstation is easy to install and use. It fits 55-gallon steel tight-head drums, and works with all types of rotary drum pumps.  Made of durable, non-corrosive and chemically resistant polyethylene, the Drip Sentinel Drum-Top Workstation helps to reduce waste removal costs and dangerous slip-and-fall incidents while saving time and money.  The Drip Sentinel Drum-Top Workstation pays for itsel fin one use by saving up to 4 gallons of liquid per drum!\r\n\r\nEquipped with a stainless steel mesh strainer, spilled liquids flow back into the drum ready for use.\r\n\r\nDrum heads can become a mess when dispensing materials, wasting resources and spreading contaminates through the work area.\r\n\r\nDrip Sentinel Drum Top Workstation saves material, returns it fresh to the dispensing drum, and keeps the drum head clean, helping to eliminate the spread of the mess.','3 lbs. / 1.4 kg.','','','','','','N/A','','2011-02-18 19:16:39','2011-05-04 21:26:49',159);
INSERT INTO `items` VALUES (105,'Hazard Hut','0.00',1,1,'4000-YE','The Solution To Your Indoor Storage Problem Is Outdoor Containment.','<iframe title=\"YouTube video player\" width=\"360\" height=\"300\" src=\"http://www.youtube.com/embed/b42JM5w0H9g?rel=0\" frameborder=\"0\" allowfullscreen></iframe>\r\n\r\nWhen floor space is at a premium indoors, take your hazardous materials outdoors with the Hazard Hut. One-piece molded 100% polyethylene construction means there are no joints or seams to leak. Molded-in side vents reduce fumes, while UV protection makes it a durable performer outside. Removable grates make it easy to clean and the 72-gallon sump capacity ensures leak and spill containment.\r\n\r\nSecurity is no problem. The double doors provide easy access for up to four 55-gallon drums while their double-wall construction, heavy-duty hinges and lock latches keep contents secure. Four-way forkliftable design makes the Hazard Hut easy to handle.\r\n\r\nDoor Opening 41.5\" W x 48.5\" H\r\n\r\nMassive sump has removable structural foam grates for easy cleaning.','269 lbs. / 121.8 kg.','4000 lbs. / 1814 kg.','72 gal. / 275.5 L','','','','Cube','EPA 40 CFR 264.175, SPCC, NPDES, UFC','2011-02-18 19:16:39','2011-04-24 11:22:09',157);
INSERT INTO `items` VALUES (106,'Hazard Hut Poly-Ramp','0.00',1,1,'4001-BK','Hazard Hut Poly-Ramp','Loading the Hazard Hut is easy with our Hazard Hut Poly-Ramp. With 5” polyolefin wheels, just roll up the ramp and roll in the barrels!\r\n\r\nHazard Hut Poly-Ramp features:\r\n\r\n• Integrally-molded handles\r\n• 10˚ slope allows for easy loading\r\n• Improved ribbed, non-skid surface\r\n• 100% polyethylene','154 lbs. / 69.9 kg.','1000 lbs. / 453.7 kg.','','','','','Standard','','2011-02-18 19:16:39','2011-04-24 11:21:14',41);
INSERT INTO `items` VALUES (107,'Job Hut','0.00',1,1,'4010-YE','Outdoor Storage Has Never Been So Practical...Or So Affordable!','If easy access, cost efficiency and a large storage area are what you need, Job Hut is the answer.  An extra large storage area lets you store up to eight 55-gallon drums right on their pallets! Its low profile design allows for easy access. And it’s forkliftable from all sides for effortless handling. Tough polyethylene construction means it won’t rust or corrode while UV inhibitors make it extra durable for outdoor use. A large 75-gallon sump capacity eliminates the risk of spills or leaks. Structural foam grates also remove for easy cleaning. What’s more, molded-in vents reduce fumes and condensation inside, while heavy-duty hinges and lock keep contents secure. The Job Hut offers substantial savings when compared to similar metal or concrete storage buildings, while providing superior performance. The optional ramp facilitates loading your drums into the unit. Safe, secure, and cost-effective.\r\n\r\nShown with optional Multi-Purpose Work Ramp (Part #: 5111-BK) and user installed tie-downs.','480.2 lbs. / 217.8 kg.','8000 lbs. / 3629 kg.','72 gal. / 272.5 L','','','','Cube','EPA 40 CFR 264.175, SPCC, NPDES, UFC','2011-02-18 19:16:39','2011-04-24 11:21:14',40);
INSERT INTO `items` VALUES (108,'2-Drum Hardcover & Spillpallet','0.00',1,1,'4062-YE','2-Drum Hardcover & Spillpallet','Ideal for indoor/outdoor storage of up to two (2) 55-gallon drums. Roll-top design allows for use in limited space or next to buildings where swing-open doors could be a problem. Top or front/rear loadable with removable grates for easy cleaning. Lockable door! Used in conjunction with Poly-Spillpallet™ 2000 (Part #: 5253-YE). Shipped knocked down only, assembly required.\r\n\r\nShown with optional Poly-Ramp (Part #: 5039-BK) and Ramp Extender (Part #: 5038-BK).\r\n\r\nOptional Drain available.','210 lbs. / 95 kg.','2000 lbs. /  907.2 kg.','58 gal. / 219.6 L','','','','Cube','EPA 40 CFR 264.175, SPCC, NPDES, UFC','2011-02-18 19:16:39','2011-04-24 11:21:14',39);
INSERT INTO `items` VALUES (109,'4-Drum Hardcover & Spillpallet','0.00',1,1,'4064-YE','4-Drum Hardcover & Spillpallet','<iframe title=\"YouTube video player\" width=\"360\" height=\"300\" src=\"http://www.youtube.com/embed/zjsUWvsEQ5E?rel=0\" frameborder=\"0\" allowfullscreen></iframe>\r\n\r\nA sturdy solution to indoor/outdoor storage of up to four (4) 55-gallon drums. Roll-top design allows it to be used in limited space or next to buildings where swing-open doors could be a problem. Takes up less than 25 square feet of floor space. Allows ample room for drum pumps. Used in conjunction with Poly-Slim-Line™ 6000 (Part #: 5400-YE). Weatherproof and Lockable Door!  Optional drain and ramp. Removable grates for easy cleaning. Some assembly required.  \r\n\r\nShown with optional ramp','269 lbs. / 122 kg.','6000 lbs. / 2721.6 kg.','66 gal. / 249.8 L','','','','Cube','EPA 40 CFR 264.175, SPCC, NPDES, UFC','2011-02-18 19:16:39','2011-04-24 11:21:58',147);
