INSERT INTO `items` VALUES (116,'Drip-Sentinel-Maintenance-Blanket-12x3','0.00',1,1,'4720-BK','Drip Sentinel™ Maintenance Blankets','The ENPAC Maintenance Blanket is designed to be utilized under vehicles orleaking equipment. The blanket is made of 8 oz. non-woven geo-textile that is 100 mils thick, backed by 1 layer of 20-milfuel/chemical resistant polyethylene.  The blanket provides a protective sorbent pad between the maintenance item and placement area. The fabric backing provides an extra barrier that unless punctured, stops any hydrocarbon from getting to ground. The blanket canbe rolled or folded into a compact lightweight unit. It is an inexpensive alternative to heavier, more costly fabric mats. Custom Sizes Available.','6 lbs. / 2.7 kg.','','','','','','Sorbent','EPA, SPCC, NPDES','2011-02-18 19:16:40','2011-05-03 18:32:35',48);
