INSERT INTO `items` VALUES (171,'Stinger-Berm14x85x1','0.00',1,1,'4885-BK-SU','The Worldwide Leader In Large, Aggressive And Immediate Spill Response.','ENPAC’s Stinger Berm leads the industry with its wide range of sizes and capacities for large-scale spill containment. Stinger Berms feature excellent rip, tear and puncture resistance for the most demanding application or terrain. Ground Pad and TrackMat provide additional protection.\r\n\r\n\r\n\r\n• Easy to assemble snap-up design permits immediate response\r\n\r\n• Compact storage and transport\r\n\r\n• Air-lance tested containment welds for maximum product performance\r\n\r\n• Lap joint welds for maximum\r\nstrength\r\n\r\n• Individual serial numbers\r\n\r\n• CAD designed and cut components\r\n\r\n• Fuel/chemical resistant containment\r\narea\r\n\r\n• Custom sizes and special materials\r\navailable \r\n\r\nOptions include:\r\n•Ground Pad\r\n•Tracmat\r\n•Storage and Transport Bag\r\n•Bazooka Trickle Filter\r\n\r\n<a href=\"customize-berms\">Click here for our customization form &gt;</a>','420 lbs. / 190 kg.','','8901 gal. / 33693 L','','','','Flexible','EPA, SPCC, NPDES','2011-02-18 19:16:46','2011-05-03 16:13:33',50);
