INSERT INTO `items` VALUES (173,'Deluxe-Berm-Repair-Kit-12','0.00',1,1,'48-BRK-DLX-12','Berm Repair Kit™ - 12\"','For 12” side wall containment berms Contents:\r\n• XR Material 1 sq. yd. (Black)\r\n• PVC material 1 sq.yd. (Yellow)\r\n• (4) Replacement Berm Stays\r\n• (5)  Peel and Stick Berm Patches\r\n• (1) Hand Held Heat Gun\r\n• (1) Rubber Brayer Roller\r\n• (1) Cutting Knife\r\n• (1)  Locking Tool Box','15 lbs. / 8.4 kg.','','','','','','N/A','','2011-02-18 19:16:46','2011-05-03 17:34:24',58);
