INSERT INTO `items` VALUES (175,'STINGER RAILBERM™','0.00',1,1,'48-RSB-FS','THE EASIEST, PORTABLE RAIL SPILL CONTAINMENT BERM AVAILABLE.','Introducing our new “Stinger Rail Berm” designed to provide portable spill containment and control for bottom loading/unloading rail tank cars!\r\n\r\nThis lightweight containment pad is designed to provide a temporary bermed containment area around the valves below a rail tank car during loading/unloading operations. Only 80 lbs, it can beeasily lifted into place by two operators!\r\n\r\nThe berm provides a 4’ x 4’ x 12” H berm area that sits in the void between the tracks directly under thevalves. Should a large release occur,captured product would begin to fill,this berm; the spilled product would then be directed over the outside rail to a side compartment 4’ x 18” x 12” H. This outside compartment is fitted with two 2” drains that includes a male CAM-LOC fitting for quick coupling of system to hoses that can transport the spilled materials to a nearby catchment area.','40 lbs. / 18.1 kg.','','120 gal. / 455 L','','','','Flexible','EPA, SPCC, NPDES','2011-02-18 19:16:46','2011-04-24 11:21:27',61);
