INSERT INTO `items` VALUES (177,'Poly-Spillpallet™ 6000','0.00',1,1,'5001-YE','Designed To Hold The Heavy Load.','Rated at 6,000 lbs. UDL weight with a 83-gallon sump capacity that meets EPA 40 CFR 264.175.\r\nSquare 50” x 50” footprint saves space yet easily holds four 55-gallon drums. Includes the same rugged features as the 2000. Optional drain. \r\n\r\n•  Two (2) removable grates\r\n•  Forkliftable from all sides ','88 lbs. / 40 kg.','6000 lbs. / 2722 kg.','83 gal. / 314.1 L','','','','Standard','EPA 40 CFR 264.175,\r\nSPCC and NPDES','2011-02-18 19:16:46','2011-05-19 16:47:51',64);
