INSERT INTO `items` VALUES (183,'Poly-Spillpallet™ 3000','0.00',1,1,'5102-YE','Where No Drum Storage Has Gone Before. ','<iframe title=\"YouTube video player\" width=\"360\" height=\"300\" src=\"http://www.youtube.com/embed/6CP8fHFYA5g?rel=0\" frameborder=\"0\" allowfullscreen></iframe>\r\n\r\nStoring drums in-line near the wall, between columns, and in all those spaces you thought were unusable. Optional drain.\r\n\r\n•  Holds four 55-gallon drums\r\n•  Low 12” profile\r\n•  Holds up to 3,000 lbs UDL wt.\r\n•  Raised edge on back and sides\r\n   helps orient barrels on pallet\r\n•  Non-skid, removable grates\r\n•  66-gallon sump capacity meets\r\n   EPA 40 CFR 264.175 \r\n•  100% polyethylene','83.7 lbs. / 37.9 kg.','3000 lbs. / 1361 kg.','66 gal. / 249.8 L','','','','Standard','EPA 40 CFR 264.175,\r\nSPCC and NPDES','2011-02-18 19:16:47','2011-04-24 11:21:28',63);
INSERT INTO `items` VALUES (184,'8-Drum Workstation','0.00',1,1,'5110-YE','There’s no need to worry about incidental spills on your factory floor. ENPAC’s Workstations are the easiest to load with a low profile design and optional ramp. Each Workstation is designed for stand alone use or can connect with other Workstations for a customized work area.  ','<iframe title=\"YouTube video player\" width=\"360\" height=\"300\" src=\"http://www.youtube.com/embed/ooyCSftd22Q?rel=0\" frameborder=\"0\" allowfullscreen></iframe>\r\n\r\nThere’s no need to worry about incidental spills on your factory floor. ENPAC’s Workstations are the easiest to load with a low profile design and optional ramp. Each Workstation is designed for stand alone use or can connect with other Workstations for a customized work area.  \r\n\r\n•  Tough, one-piece polyethylene\r\n   construction, will not rust or corrode.\r\n•  Low-profile Workstations \r\n   become part of your factory floor,\r\n   optimizing space for increased\r\n   safety and efficiency. Makes drum\r\n   loading a snap.\r\n•  Large sump capacity catches \r\n   incidental spills. \r\n•  Multi-Purpose Work Ramp\r\n   hooks onto any Workstation for\r\n   easy loading.\r\n•  Removable heavy-duty structural \r\n   foam grates for easy cleaning.\r\n•  Rolled-edge design helps\r\n   resist cracking and warpage.\r\n\r\nNote: Workstations are forklift-ready while empty.','173 lbs. / 78.5 kg.','8000 lbs. / 3629 kg.','77 gal. / 291.4 L','','','','Standard','EPA 40 CFR 264.175, SPCC, NPDES, UFC','2011-02-18 19:16:47','2011-04-24 11:22:09',156);
