INSERT INTO `items` VALUES (192,'Poly-Spillcart','0.00',1,1,'5200-YE','Get On The Move!','Transporting 55-gallon drums, 5-gallon pails, paint cans and other materials around your plant has never been easier. Poly-Spillcart eliminates the risk of spills during transport with its 57-gallon sump capacity.\r\n\r\nPoly-Spillcart’s caster wheels let\r\nyou move around freely, while its\r\nergonomically-designed handle\r\nmakes maneuvering a breeze.\r\nA tray for tool storage keeps tools\r\nclean and handy. The structural\r\nfoam grate removes for easy\r\ncleaning while the drain plug lets\r\nyou drain the sump without effort.','132 lbs. / 60 kg.','500 lbs. / 227 kg.','57 gal. / 215.7 L','','','','Standard','EPA 40 CFR 264.175, SPCC, NPDES','2011-02-18 19:16:48','2011-04-24 11:21:29',68);
INSERT INTO `items` VALUES (193,'Poly-Spillcart ATC','0.00',1,1,'5200-YE-A','Get On The Move!','Transporting 55-gallon drums, 5-gallon pails, paint cans and other materials around your plant has never been easier. Poly-Spillcart eliminates the risk of spills during transport with its 57-gallon sump capacity.\r\n\r\nPoly-Spillcart’s caster wheels let\r\nyou move around freely, while its\r\nergonomically-designed handle\r\nmakes maneuvering a breeze.\r\nA tray for tool storage keeps tools\r\nclean and handy. The structural\r\nfoam grate removes for easy\r\ncleaning while the drain plug lets\r\nyou drain the sump without effort.','125 lbs. / 57 kg.','500 lbs. / 227 kg.','57 gal. / 215.7 L','','','','Standard','EPA 40 CFR 264.175, SPCC, NPDES','2011-02-18 19:16:48','2011-04-24 11:21:29',72);
INSERT INTO `items` VALUES (194,'Spill Scooter™','0.00',1,1,'5205-YE','Spill Scooter™','<iframe title=\"YouTube video player\" width=\"360\" height=\"300\" src=\"http://www.youtube.com/embed/nrePiajthM0?rel=0\" frameborder=\"0\" allowfullscreen></iframe>\r\n\r\nThe ORIGINAL Mobile Dispensing Scooter.\r\n\r\nDispensing drums while transporting them around the plant is no longer a problem thanks to our Spill Scooter. The Spill Scooter  provides secondary containment  or incidental spills and drips which often occur during vertical dispensing applications.\r\n\r\nIncidental spills and drips are contained in the well with a spout for easy draining. The Spill Scooter fits all drums up to 55 gallons. Made of 100% polyethylene, the Spill Scooter will not rust or corrode.\r\n\r\nFeatures a built-in bung fitting holder.\r\n','22 lbs. / 9.9 kg.','500 lbs. / 227 kg.','11 gal. / 41.6 L','','','','Circular','EPA, SPCC and NPDES','2011-02-18 19:16:48','2011-04-24 11:21:28',66);
