INSERT INTO `items` VALUES (196,'Poly-Labtray™','0.00',1,1,'5248-YE','Brings Spill Protection To The Laboratory Bench.','Poly-Labtrayreduces spills and overflows of liquid and free-flowing powderchemicals during transfer of material in the laboratory. Its largesurface holds four 1-gallon bottles (up to 40 lbs. static load weight)and the unit features up to 2.5 gallon sump capacity. This makes it perfect for mixing small containers at production sites. There are no metal parts to rust or corrode.\r\n\r\nLow-profile unit is only 3” high\r\nSmall 25” x 21.5” footprint','3.8 lbs. / 1.7 kg.','40 lbs. / 18 kg.','2.5 gal. / 9.4 L','','','','Standard','EPA, SPCC and NPDES','2011-02-18 19:16:49','2011-04-24 11:21:29',70);
