INSERT INTO `items` VALUES (198,'Poly-Spillpallet™ 2000','0.00',1,1,'5253-YE','Poly-Spillpallet™ 2000','<iframe title=\"YouTube video player\" width=\"360\" height=\"300\" src=\"http://www.youtube.com/embed/BlzEtWfd1JU?rel=0\" frameborder=\"0\" allowfullscreen></iframe>\r\n\r\nThis secondary containment system is engineered to meet the rigors of today’s regulatory environment. With 100% polyethylene, it provides excellent chemical resistance. Optional drain with plug.\r\n\r\n• Meets EPA 40 CFR 264.175\r\n• Holds up to 2,000 lbs UDL\r\n• Forkliftable\r\n• Removable grates for easy cleaning','55.5 lbs. / 25.1 kg.','2000 lbs. / 907 kg.','58 gal. / 219.5 L','','','','Standard','EPA 40 CFR 264.175,\r\nSPCC and NPDES','2011-02-18 19:16:49','2011-04-24 11:21:57',145);
INSERT INTO `items` VALUES (199,'Poly-Tank® Containment Unit 275™','0.00',1,1,'5275-BK','Keep Hazardous Liquid Stored Safely Above The Ground.','Designed for the widely used 275-gallon obround tank, the Poly-Tank Containment Unit/275 will help protect against hazardous and costly spills. It boasts a large 275-gallon sump which saves space an provides easy access to the tank and pumps. The Poly-Tank Containment Unit/275 prevents harmful oil spills from contaminating your yard. Optional bulkhead fittings make pumping and draining simple (Part #: 5276). Tarp (Part #: 5275-TARP) and trickle filter also available.\r\n\r\n','98 lbs. / 41.4 kg.','','275 gal. / 1040.9 L','','','','Cube','EPA 40 CFR 264.175, SPCC and NPDES','2011-02-18 19:16:49','2011-04-24 11:21:30',75);
