INSERT INTO `items` VALUES (209,'IBC 2000i™','0.00',1,1,'5469-YE','Intermediate Bulk Containment Made Easy.','ENPAC Corporation’s integrated IBC 2000i gives intermediate bulk container users more versatile spill containment. It fits more than 99% of all IBC dispensing units and features a large sump capacity of 385 gallons, more than exceeding EPA 40 CFR 264.175  regulations. The unit also comes with an integrated 5-gallon pail holder for quick and easy dispensing. \r\n\r\nThe IBC 2000i is the only one-piece, lightweight, 100% polyethylene IBC spill containment unit that is forkliftable and nestable for convenient shipment and storage,\r\nand reduces shipping costs.\r\nThe polyethylene construction will not rust or corrode or have adverse reactions with chemicals.\r\n\r\nOptional Drain.','291.2 lbs. / 132 kg.','8000 lbs. / 3629 kg.','385. gal. / 1457.3 L','','','','Cube','EPA 40 CFR 264.175,\r\nSPCC and NPDES','2011-02-18 19:16:50','2011-04-24 11:21:59',151);
INSERT INTO `items` VALUES (368,'ENSORB® SOK 15-Gallon Drum','0.00',1,1,'EC029-0025-00EP','Spill & Odor Killer - Neutralizing & Odor-eliminating absorbent!','Quickly neutralize odors at the source with ENSORB SOK, the revolutionary odor eliminating absorbent! Effective and environmentally safe, this rapid-action Spill and Odor Killer is safe to use around kids, pets and virtually anywhere! Ideal for larger spills and refills, the 5 and 15 gallon SOK units will tackle your biggest, nastiest spills with no fear of lingering odor or residue. ','35 lbs. / 15.9 kg','','',NULL,NULL,NULL,'Sorbent',NULL,'2011-05-19 16:47:11','2011-05-19 16:47:49',170);
