INSERT INTO `items` VALUES (227,'1-Drum Spillpal™','0.00',1,1,'5750-YE','The Most Affordable, The Most Convenient Temporary Storage.','The flexible-sidewall SpillPal line is the easiest to use and the most affordable hazardous material storage product on the market today. SpillPal provides incidental spill control during temporary storage of drums, machine parts, tanks and generators. It can also be used as a washdown pad or pumping station. An alternative to hard plastic pallets that need to be moved by a forklift and are always in the way, ENPAC’s SpillPal features 3” foam sidewalls that easily spring back into place after any type of pressure is applied. With six configurations, SpillPal almost eliminates the need for bulky, hard plastic pallets. Custom sizes available.\r\n\r\nOptional Grates available (Part #: 7006-BK).','2 lbs. / 1 kg.','','7.5 gal. / 28 L','','','','Flexible','EPA, SPCC, NPDES','2011-02-18 19:16:53','2011-04-24 11:21:58',148);
