INSERT INTO `items` VALUES (238,'Poly-Racker™','0.00',1,1,'6000-YE','Poly-Racker™','The centerpiece of the Poly-Rack System is the Poly-Racker,  a unique one-piece polyethylene rack that holds two 55-gallon drums securely in place. A massive 100-plus gallon containment sump ensures spill safety even in worst-case drum leaks. The deep dispensing well easily holds 5-gallon pails while containing incidental spills and splashes in a ribbed bottom without contaminating the sump. Dispensing wells have a scalloped edge so pails can be easily removed. Poly-Rackers can be transported by forklift as separate pieces and contain two (2) standard drain plugs. ','121.5 lbs. / 55 kg.','3000 lbs. / 1361 kg.','103 gal. / 386.1 L','','','','Standard','EPA 40 CFR 264.175, SPCC, NPDES','2011-02-18 19:16:54','2011-04-24 11:21:36',97);
INSERT INTO `items` VALUES (239,'Poly-Stacker™','0.00',1,1,'6002-YE','Poly-Stacker™','Combine a single Poly-Stacker with a Poly-Racker to stack up\r\nto four (4) drums. Add another Poly-Stacker and you have a storage system that holds six (6) drums. Rated with a 3,000 lbs handling capacity. \r\n\r\nEach Poly-Stacker holds two 55-gallon drums and can quickly be stacked with a forklift. Any spills from the second and third levels fall into the dispensing well for containment and easy clean-up. Combined, Poly-Racker and Poly-Stacker create the most efficient drum storage and dispensing system money can buy.','60 lbs. / 25.3 kg.','2400 lbs. / 1088.6 kg.','','','','','Standard','','2011-02-18 19:16:54','2011-04-24 11:21:36',98);
INSERT INTO `items` VALUES (240,'Poly-Shelf™','0.00',1,1,'6003-YE','Poly-Shelf™','Save money and prevent spills! Increase safety and productivity when you add the Poly-Shelf to your Poly-Rack System. It easily attaches to a Poly-Stacker and allows simultaneous dispensing from all drums. Spills? A hole in the bottom of the Poly-Shelf drains into the dispensing well in the Poly-Racker.','10 lbs. / 4.5 kg.','60 lbs. / 27.2 kg.','','','','','Standard','','2011-02-18 19:16:54','2011-04-24 11:21:36',101);
INSERT INTO `items` VALUES (241,'Multi-Purpose Racker Stacker ','0.00',1,1,'6004-YE','Rack\'em and Stack\'em!','<iframe title=\"YouTube video player\" width=\"360\" height=\"300\" src=\"http://www.youtube.com/embed/jtnTR70E96E?rel=0\" frameborder=\"0\" allowfullscreen></iframe>\r\n\r\nMaximize floor space with the Multi-Purpose Racker/Stacker. One Multi-Purpose Racker/Stacker holds up to two 55-gallon drums. The stackable unit allows you to double your efficiency and store up to four 55-gallon drums. The Racker-Stacker can be placed on the floor (no sump) or on the Poly-Slim Line 6000 pallet (Product No. 5400-YE). Use with the Poly-Shelf (Product No. 6003-YE as seen above) for easy dispensing into 5 or 6-gallon pails. Forkliftable!','87.7 lbs. / 39.9 kg.','2400 lbs. / 1088.6 kg.','','','','','Standard','EPA 40 CFR 264.175','2011-02-18 19:16:54','2011-04-24 11:21:34',93);
INSERT INTO `items` VALUES (242,'Universal® Well Liner','0.00',1,1,'6005-BK','Universal® Well Liner','The Universal Well Liner\r\nprovides extra spill protection.\r\nTo reclaim spilled material,\r\njust lift up the liner. \r\n\r\nNo cleaning, wiping or scrubbing!','1.25 lbs. / .6 kg.','','.4 gal. / 1.9 L','','','','Standard','','2011-02-18 19:16:54','2011-04-24 11:21:35',96);
INSERT INTO `items` VALUES (243,'Single Poly-Racker™','0.00',1,1,'6006-YE','Single Poly-Racker™','Economical, space-saving solution\r\nto storing and dispensing from\r\n55-gallon drums. The system\r\nconsists of separate single\r\nPoly-Racker, single Poly-Stacker,\r\nUniversal  Well Liner and\r\nPoly Shelf. The Poly Stacker\r\nallows for stacking of a second\r\n55-gallon drum.  The system holds\r\n1,600 lbs and the Poly-Racker\r\nfeatures a 66-gallon sump capacity!','95.45 lbs. / 43.2 kg.','1600 lbs. / 726 kg.','66 gal. / 249.8 L','','','','Standard','EPA 40 CFR 264.175,\r\nSPCC and NPDES','2011-02-18 19:16:55','2011-04-24 11:21:36',99);
INSERT INTO `items` VALUES (244,'Single Poly-Stacker™','0.00',1,1,'6007-YE','Single Poly-Stacker™','Economical, space-saving solution\r\nto storing and dispensing from\r\n55-gallon drums. The system\r\nconsists of separate single\r\nPoly-Racker, single Poly-Stacker,\r\nUniversal Well Liner and Poly Shelf.\r\nThe Poly Stacker allows for stacking\r\nof a second 55-gallon drum.\r\nThe system holds 1,600 lbs and\r\nthe Poly-Racker features \r\n66-gallon sump capacity!','50.35 lbs. / 22.8 kg.','800 lbs. / 363 kg.','','','','','Standard','','2011-02-18 19:16:55','2011-04-24 11:21:36',100);
INSERT INTO `items` VALUES (245,'Mini-Racker™','0.00',1,1,'6010-YE','Mini-Racker™','The NEW Mini Racker-Stacker™ System is ideal for storage and dispensing of small containers with built-in spill protection and patented enclosed sump. The system has a mobility option to make movement in the plant environment safe and easy too.  The Mini Racker-Stacker™ System helps save liquids that are routinely lost during the dispensing process and helps protect worker safety by keeping the dispensing area neat and clean.\r\n\r\nThe Mini Racker Stacker™ System consists of the base Racker that will hold two (2) 5-6.5 US gallon metal or plastic lidded pails or cans, or two (2) 5 US gallon or smaller metal or plastic “jerry cans”. The Racker module is available in two (2) versions:  \'Place and Use\' (6010-YE) and  \'Mobile\' (6011-YE-M) which includes wheels and handle. The Stacker module can be used in conjunction with the Racker to add an extra level of storage, or separately with another containment solution to mix-and-match the user’s specific need.','25.25 lbs. / 11 kg.','200 lbs. / 91 kg.','8 gal. / 30.2 L','','','','Standard','EPA 40 CFR 264.175,\r\nSPCC and NPDES','2011-02-18 19:16:55','2011-04-24 11:21:59',150);
INSERT INTO `items` VALUES (246,'Mini-Racker™ Mobile Unit','0.00',1,1,'6011-YE-M','Mini-Racker™ Mobile Unit','Its wheels and handle make the\r\nMini Racker-Stacker™ Mobile Unit portable throughout the plant. \r\nIt easily fits through standard doorway openings.\r\n\r\nHandle flips up on the Mobile Unit for compact storage.','31 lbs. / 14.1 kg.','200 lbs. / 91 kg.','8 gal. / 30.2 L','','','','Standard','EPA 40 CFR 264.175,\r\nSPCC and NPDES','2011-02-18 19:16:55','2011-04-24 11:21:40',115);
INSERT INTO `items` VALUES (247,'Mini-Stacker™','0.00',1,1,'6012-YE','Mini-Stacker™','Made of highly durable and chemically compatible polyethylene, ENPAC’s Mini Racker-Stacker™ System is equipped with patented enclosed sump so that spills are truly portable, and the user isn’t “stuck” when a spill occurs like with other larger competitive products.','15.1 lbs. / 7 kg.','100 lbs. / 45 kg.','','','','','Standard','','2011-02-18 19:16:55','2011-04-24 11:21:37',102);
