INSERT INTO `items` VALUES (249,'6-Pack Cylinder Rack™','0.00',1,1,'7202-YE','6-Pack Cylinder Rack™','Maximize floor space while eliminating clutter and safety hazards by properly storing your industrial cylinders. Efficiently sized to easily move through standard doorways and is forkliftable! (Do not forklift while loaded) Handles cylinders 3” to 10” diameter. Add optional lower strap to bottom for extra security (Part #: 7205-BK).\r\n\r\nShown with optional Ramp (Part #:. 7203--BK).\r\n','51.8 lbs. / 23.5 kg.','1200 lbs. / 544 kg.','','','','','Standard','OSHA 29 CFR.1910.253','2011-02-18 19:16:55','2011-04-24 11:21:40',116);
