INSERT INTO `items` VALUES (259,'Single Cylinder Dolly™ HD','0.00',1,1,'7301-BK','Single Cylinder Dolly™ HD','Just as durable and half the size. The Single Cylinder Dolly HD is designed for demanding industrial facilities or tough outdoor applications in which transport of a single cylinder is required. Accommodates one cylinder, up to 12” in diameter, including class 300 SCF industrial gas cylinders and No. 5 acetylene cylinders.\r\n\r\nRugged, solid wheels come standard on Part #: 7301-BK-A to maximize maneuverability over rough terrain.','26.8 lbs. / 12.2 kg.','250 lbs. / 113.4 kg.','','','','','Standard','OSHA 29 CFR.1910.253','2011-02-18 19:16:57','2011-04-24 11:21:38',108);
