INSERT INTO `items` VALUES (261,'Dual Cylinder Dolly™','0.00',1,1,'7302-BK','Easier cylinder loading, better maneuverability and large tray for tools.','The Dual Cylinder Dolly is\r\ndesigned to be a more functional, maneuverable and better balanced transporter for gas cylinders than conventional dollies or forklifts.\r\nIdeal for industrial or construction operations, the Dual Cylinder Dolly accommodates any two cylinders, each up to 12” in diameter,\r\nincluding class 300 SCF industrial gas cylinders and No. 5 acetylene cylinders.\r\n\r\nThe dolly’s lightweight yet durable polyethylene construction and effective counter balancing makes it easy to handle with a minimum of physical effort. Tough 16.5” diameter pneumatic wheels offer the best maneuverability over any terrain. \r\n\r\nUnlike metal cylinder carts, the Dual Cylinder Dolly is spark-resistant and the rugged polyethylene construction will not rust or corrode under harsh weather conditions.\r\n\r\n36” built-in tray holds tools, valves and torches.','56.9 lbs. / 25.8 kg.','500 lbs. / 227 kg.','','','','','Standard','OSHA 29 CFR.1910.253','2011-02-18 19:16:57','2011-04-24 11:21:38',107);
INSERT INTO `items` VALUES (262,'Poly-Collector 66 (Poly Drum)','0.00',1,1,'8001-YE','Get Your Waste Collection On The Move.','The Poly-Collector™ Portable Hazardous Materials Collection Systems put mobility into containment so you can go where\r\nthe waste is. These caster-mounted containers are built tough from UV-stabilized polyethylene for excellent chemical resistance to a broad range of industrial materials. \r\n\r\nModel is equipped with the unique Poly Drum Funnel™ 55 to prevent over-spills while allowing multiple oil filters, pails, and cans to drain at once. Both products are ideal for collecting waste oil, antifreeze and chemicals. The Poly-Collector 110 outer shell holds 105 gallons, with an inner drum that holds 55 gallons. A twist-on lid on the Poly-Collector 110 unit ensures safe and easy closure. The Poly-Collector 66 poly outer shell holds 66 gallons while the inner drum holds 55 gallons.','81.15 lbs. / 36.8 kg.','600 lbs. / 272 kg.','70 gal. / 264.9 L','','','','Drum','EPA 40 CFR 264.175, SPCC, NPDES','2011-02-18 19:16:57','2011-04-24 11:21:59',123);
