INSERT INTO `items` VALUES (268,'Drums-Up™','0.00',1,1,'8091-YE','The Incidental Spill Solution.','<iframe title=\"YouTube video player\" width=\"360\" height=\"300\" src=\"http://www.youtube.com/embed/nZmLw48wygs?rel=0\" frameborder=\"0\" allowfullscreen></iframe>\r\n\r\nNeed temporary protection against incidental barrel spills? Our Drums-Up and Drums-Up Jr. let you control nuisance spills from drums sized up to 55 gallons. A 19.5-gallon sump capacity catches liquid before it reaches your floor, reducing the risk of slip and fall injuries.\r\n\r\nIdeal for use as a drum pumping station. ','5.95 lbs. / 2.7 kg.','','20 gal. / 75.7 L','','','','Drum','EPA, SPCC and NPDES','2011-02-18 19:16:58','2011-04-24 11:21:41',119);
