INSERT INTO `items` VALUES (270,'Bazooka™','0.00',1,1,'BAZOOKA','Trickle Filter w/Automatic Shutoff','Introducing an exciting new product from ENPAC, The Imbiber Bead® Bazooka™! It is an automated shut off system which allows water drainage of containment berm applications. It also utilizes an innovative system for detection of Class I & II organics such as diesel fuel. Water will continually drain through the filter, but in case of a spill within the berm (when an organic substance is detected)  the Imbiber Bead® technology takes over and the flow is completely shut off. It is a virtually maintenance free design with very simple upkeep.','8 lbs. / 3.6 kg.','','','','','','Circular','EPA, SPCC, NPDES','2011-02-18 19:16:58','2011-04-24 11:21:58',149);
INSERT INTO `items` VALUES (271,'Bazooka™ Installation Kit','0.00',1,1,'BAZOOKA-12KIT','Bazooka™ Installation Kit','The kit contains all you need for\r\nan easy field installation of the\r\nENPAC Imbiber Bead® Bazooka™                          can be completed in just minutes! ','10 lbs. / 4.5 kg.','','','','','','Circular','EPA, SPCC, NPDES','2011-02-18 19:16:59','2011-04-24 11:21:42',122);
INSERT INTO `items` VALUES (272,'ENSORB™ Sorbents','0.00',1,1,'ENP 10 NHS38','ENSORB™ SOCKS Aggressive','Our line of bonded natural sorbents are manufactured using highly absorbent, natural renewable-resource fibers. Making EnSorb™ an exceptional value. EnSorb™ bonded natural sorbents are constructed from a single layer of extremely fine natural fibers that are point-bonded together. Proprietary chemical additives maximize and enhance the fibers water repulsion, flame resistance (equal to or better than polypropylene), and resistance to microbes. EnSorb™ is manufactured with virtually no dependency on domestic or foreign oil production utilizing largely American grown renewable resources. Our EnSorb™ bonded product line ~ based on ASTM test standard 726 ~ on average, absorbs better than competing products by approximately 40%.','','','','','','','Sorbent','','2011-02-18 19:16:59','2011-04-24 11:21:41',121);
