INSERT INTO `items` VALUES (299,'ENSORB™ Super Absorbent','0.00',1,1,'ENP D503','ENSORB™ Super Absorbent is a non-toxic, non-flammable, environmentally safe and friendly, lightweight and powerful substance that can absorb and hold all liquids* while leaving little or no residue.','<p>\r\n	ENSORB Super Absorbent&trade; has unlimited uses. Immediately absorbing liquids of any viscosity, leaving surfaces clean and dry. &nbsp; Features:</p>\r\n<ul>\r\n	<li>\r\n		15 to 20 times the absorption capacity of clay-based products.</li>\r\n	<li>\r\n		Extraordinary versatility in absorbing any kind of liquid or semi-liquid on contact and permanently encapsulates absorbed materials. This includes all animal, vegetable, mineral, petroleum, and chemical liquids*.</li>\r\n	<li>\r\n		Virtually unlimited uses as a dry absorbent that is safe in all applications.</li>\r\n	<li>\r\n		Picks up all liquids, of any viscosity, off any hard surface, leaving that surface clean and dry.</li>\r\n	<li>\r\n		Turns the spilled liquid into a solid that can be disposed of easily.</li>\r\n	<li>\r\n		Lightweight and simple to use, it dramatically reduces clean up costs, as well as the ever-increasing costs of disposal.</li>\r\n	<li>\r\n		Not injurious to soil, cement, asphalt, tile, plants, animals, or humans.</li>\r\n	<li>\r\n		Contains no reactive chemicals, is not toxic, flammable, or biodegradable, and is environmentally safe and friendly.</li>\r\n</ul>\r\n<p>\r\n	&nbsp;</p>\r\n<p>\r\n	<iframe allowfullscreen=\"\" frameborder=\"0\" height=\"300\" src=\"http://www.youtube.com/embed/NQaX8KWi7Fk?rel=0\" title=\"YouTube video player\" width=\"360\"></iframe></p>\r\n<p>\r\n	&nbsp;</p>\r\n<p>\r\n	ENSORB&trade; Super Absorbent is a non-toxic, non-flammable, environmentally safe and friendly, lightweight and powerful substance that can absorb and hold all liquids* while leaving little or no residue. Less than half a pound of ENSORB&trade; Super Absorbent can completely absorb one quart of motor oil without leaving any residue to re-clean. Clay, earth, and sand products require 15 pounds of material to absorb the same amount and would leave a slippery residue. ENSORB&trade; Super Absorbent requires far less absorbent to capture a spill, resulting in greatly reduced disposal costs. ENSORB&trade; Super Absorbent works on all animal, vegetable, mineral, petroleum based or semi-liquid spills. ENSORB&trade; Super Absorbent meets or exceeds all OSHA and EPA requirements for health and safety. Unlike Kitty litter products that contain &quot;Crystalline&quot; Silica, ENSORB Super Absorbent&trade; does not, under OSHA standards, qualify as a carcinogen, or as a substance causing silicosis, a lung disease. ENSORB&trade; Super Absorbent requires far less absorbent to capture a spill, resulting in greatly reduced disposal costs. ENSORB Super Absorbent&trade; is non-injurious to most surfaces including cement, asphalt, tile, carpet. ENSORB Super Absorbent&trade; leaves no residue, therefore no slips or falls. ENSORB&trade; Super Absorbent will save money on shipping, storing and disposal. It&#39;s light weight and high absorbency will make it easier to handle (less work-comp claims) *Note: Cannot be used with Hydrofluoric Acid (HF). <a href=\"http://enpac.publishpath.com/Websites/enpac/Images/PDF/ENSORB%20MSDS.pdf\"> <span style=\"color: #76923c;\">Material Safety Data Sheet (PDF Format)</span> </a> Paint (Oil or Water Based): When cleaning up a paint spill, speed is most important. If the paint has begun to dry, use a paint thinner for oil based and water for water based to rewet the spill. Then follow the normal how to use instructions. A medium to stiff bristle broom is recommended for this application. Petroleum Products (Hydraulic, Brake, Transmission fluid, Motor Oil, etc.): Follow normal how to use instructions. ENSORB&trade; Super Absorbent becomes saturated when you can no longer see any white powder. If it turns to a paste, remove the top coat and reapply. Motor Oil/ Existing Stains: Rewet the stain with a degreaser, work in with a broom. Immediately follow normal instructions. Repeat until stain is mostly removed. Greases: This is probably a multi-step process. The first step is to remove what you can. Then reapply and continue until grease is absorbed. If ENSORB&trade; Super Absorbent turns to paste, remove top coat and reapply. If Spill is large try the back of a garden rake or similar tool and this may help cut into the spill easier. Antifreeze: Use normal drop and sweep procedure. Food (Both Liquid and Semi-liquid) ENSORB&trade; Super Absorbent will absorb syrups, jams, jellies, peanut butter, vegetable oils, egg, mayonnaise, soft drinks, and juices. For all spills containing glass from the broken container, apply ENSORB&trade; Super Absorbent and work your broom in a circular pattern, then sweep up the glass and the absorbed liquid at the same time. Bodily Fluids: ENSORB&trade; Super Absorbent works very fast on bodily fluids as well as helps to diminish the odor associated with : Vomit, Urine, Blood, Etc.. Chemicals: ENSORB&trade; Super Absorbent is a non-selective absorbent except for - Do not use with Hydrofluoric Acid.</p>\r\n','','','','','','','Sorbent','','2011-02-18 19:17:03','2011-04-24 11:44:28',127);
INSERT INTO `items` VALUES (300,'ENSORB™ Super Absorbent','0.00',1,1,'ENP D503CS','ENSORB Super Absorbent™ has unlimited uses. Immediately absorbing liquids of any viscosity, leaving surfaces clean and dry.   Features: • 15 to 20 times the absorption capacity of clay-based products. • Extraordinary versatility in absorbing any kind of liquid or semi-liquid on contact and permanently encapsulates absorbed materials. This includes all animal, vegetable, mineral, petroleum, and chemical liquids*. • Virtually unlimited uses as a dry absorbent that is safe in all applications. • Picks up all liquids, of any viscosity, off any hard surface, leaving that surface clean and dry. • Turns the spilled liquid into a solid that can be disposed of easily. • Lightweight and simple to use, it dramatically reduces clean up costs, as well as the ever-increasing costs of disposal. • Not injurious to soil, cement, asphalt, tile, plants, animals, or humans. • Contains no reactive chemicals, is not toxic, flammable, or biodegradable, and is environmentally safe and friendly.','<iframe title=\"YouTube video player\" width=\"360\" height=\"300\" src=\"http://www.youtube.com/embed/NQaX8KWi7Fk?rel=0\" frameborder=\"0\" allowfullscreen></iframe>\r\n\r\nENSORB™ Super Absorbent is a non-toxic, non-flammable, environmentally safe and friendly, lightweight and powerful substance that can absorb and hold all liquids* while leaving little or no residue. Less than half a pound of ENSORB™ Super Absorbent can completely absorb one quart of motor oil without leaving any residue to re-clean. Clay, earth, and sand products require 15 pounds of material to absorb the same amount and would leave a slippery residue.\r\n\r\nENSORB™ Super Absorbent requires far less absorbent to capture a spill, resulting in greatly reduced disposal costs. ENSORB™ Super Absorbent works on all animal, vegetable, mineral, petroleum based or semi-liquid spills.\r\n\r\nENSORB™ Super Absorbent meets or exceeds all OSHA and EPA requirements for health and safety. Unlike Kitty litter products that contain \"Crystalline\" Silica, ENSORB Super Absorbent™ does not, under OSHA standards, qualify as a carcinogen, or as a substance causing silicosis, a lung disease.\r\n\r\nENSORB™ Super Absorbent requires far less absorbent to capture a spill, resulting in greatly reduced disposal costs. ENSORB Super Absorbent™ is non-injurious to most surfaces including cement, asphalt, tile, carpet. ENSORB Super Absorbent™ leaves no residue, therefore no slips or falls.\r\n\r\nENSORB™ Super Absorbent will save money on shipping, storing and disposal. It\'s light weight and high absorbency will make it easier to handle (less work-comp claims)\r\n\r\n*Note: Cannot be used with Hydrofluoric Acid (HF).\r\n\r\n<a href=\"http://enpac.publishpath.com/Websites/enpac/Images/PDF/ENSORB%20MSDS.pdf\">\r\n<address><span style=\"color: #76923c;\">Material Safety Data Sheet (PDF Format)</span></address>\r\n</a>\r\n\r\nPaint (Oil or Water Based): When cleaning up a paint spill, speed is most important. If the paint has begun to dry, use a paint thinner for oil based and water for water based to rewet the spill. Then follow the normal how to use instructions. A medium to stiff bristle broom is recommended for this application.\r\n\r\nPetroleum Products (Hydraulic, Brake, Transmission fluid, Motor Oil, etc.): Follow normal how to use instructions. ENSORB™ Super Absorbent becomes saturated when you can no longer see any white powder. If it turns to a paste, remove the top coat and reapply.\r\n\r\nMotor Oil/ Existing Stains: Rewet the stain with a degreaser, work in with a broom. Immediately follow normal instructions. Repeat until stain is mostly removed.\r\n\r\nGreases: This is probably a multi-step process. The first step is to remove what you can. Then reapply and continue until grease is absorbed. If ENSORB™ Super Absorbent turns to paste, remove top coat and reapply. If Spill is large try the back of a garden rake or similar tool and this may help cut into the spill easier.\r\n\r\nAntifreeze: Use normal drop and sweep procedure.\r\n\r\nFood (Both Liquid and Semi-liquid) ENSORB™ Super Absorbent will absorb syrups, jams, jellies, peanut butter, vegetable oils, egg, mayonnaise, soft drinks, and juices. For all spills containing glass from the broken container, apply ENSORB™ Super Absorbent and work your broom in a circular pattern, then sweep up the glass and the absorbed liquid at the same time.\r\n\r\nBodily Fluids: ENSORB™ Super Absorbent works very fast on bodily fluids as well as helps to diminish the odor associated with : Vomit, Urine, Blood, Etc..\r\n\r\nChemicals: ENSORB™ Super Absorbent is a non-selective absorbent except for - Do not use with Hydrofluoric Acid.','','','','','','','Sorbent','','2011-02-18 19:17:04','2011-04-24 11:21:46',127);
