INSERT INTO `items` VALUES (311,'ENSORB™ Sorbents','0.00',1,1,'ENP NOPB 100H','ENSORB™ PADS Oil Only','Our line of bonded natural sorbents are manufactured using highly absorbent, natural renewable-resource fibers. Making EnSorb™ an exceptional value. EnSorb™ bonded natural sorbents are constructed from a single layer of extremely fine natural fibers that are point-bonded together. Proprietary chemical additives maximize and enhance the fibers water repulsion, flame resistance (equal to or better than polypropylene), and resistance to microbes. EnSorb™ is manufactured with virtually no dependency on domestic or foreign oil production utilizing largely American grown renewable resources. Our EnSorb™ bonded product line ~ based on ASTM test standard 726 ~ on average, absorbs better than competing products by approximately 40%.','','','','','','','Sorbent','','2011-02-18 19:17:06','2011-04-24 11:21:51',121);
