INSERT INTO `items` VALUES (357,'Q-VAC 100™','0.00',1,1,'Q-VAC 100','Q-VAC 100™','Shown With Optional Drum And Scooter.\r\n\r\nEasy-to-use and highly reliable, the Q-VAC 100 pumps liquid directly into a standard drum for convenient storage or recycling.\r\nA liquid overflow shutoff valve ensures vacuum automatically turns off when drum is full. Works on shop air.\r\n\r\nMore Q-VAC™ 100 Advantages\r\n\r\nFits on a standard 55-gallon closed top drum\r\nRequires no filters\r\nNo moving parts to break or replace\r\nShown with optional Scooter (Part#: 5205-YE); Drum not included.','','','','','','','Circular','','2011-02-18 19:17:16','2011-04-24 11:21:57',141);
INSERT INTO `items` VALUES (367,'ENSORB® SOK 5-Gallon Pail','0.00',1,1,'EC029-0009-00EP','Spill & Odor Killer - Neutralizing & Odor-eliminating absorbent!','Quickly neutralize odors at the source with ENSORB SOK, the revolutionary odor eliminating absorbent! Effective and environmentally safe, this rapid-action Spill and Odor Killer is safe to use around kids, pets and virtually anywhere! Ideal for larger spills and refills, the 5 and 15 gallon SOK units will tackle your biggest, nastiest spills with no fear of lingering odor or residue. ','12 lbs. / 5.4 kg','','',NULL,NULL,NULL,'Sorbent',NULL,'2011-05-19 16:47:11','2011-05-19 16:47:49',169);
