INSERT INTO `items` VALUES (386,'Poly-Top For 20 & 30 Gallon Drums','0.00',1,1,'2030-TARP','Protect your Poly-Overpacks','Poly-top prevents the accumulation of water, snow, dirt and debris on overpack lids while protecting overpacks against weathering and long-term UV degradation. The high-visibility color and clear MSDS pocket are added features to the Poly-Top that are made to fit 20, 30, 65 & 95-Gallon Poly-Overpacks® and Spill Kits','1.3 lbs. / .6 kg','','',NULL,NULL,NULL,'Flexible',NULL,'2011-05-19 16:47:12','2011-05-19 16:47:33',187);
