INSERT INTO `items` VALUES (391,'Leak Diverter','0.00',1,1,'Leak Diverter','Your Catch-All.','Get instant drip diversion with the new Leak Diverter. This funnel-style  fast-response tool will channel away your liquids minimizing the risk of slip-and-fall injuries and contamination. A flowrate of over three (3) gallons per minute and a convenient drain hose make containing and redirecting drips, drops, and leaks a breeze! Made of durable and resistant XR5, the Diverter is resistant to most chemicals, and punctures allowing for reuse and dependability.','','','',NULL,NULL,NULL,'N/A',NULL,'2011-05-19 16:47:12','2011-05-19 16:47:12',192);
INSERT INTO `items` VALUES (392,'Flex-Pal','0.00',1,1,'Flex-Pal','Instant Pallet Containment','The versatility of portable containment meets the durability of the classic spill-pallet with the all-new ENPAC® FlexPal. Available in multiple variations and sizes, these units give you the accessibility of fabric combined with the strength of rigid pallets ENPAC® is known for producing worldwide. Cross-stabling technology keeps your drums out of the spill and allows access to the sump for easy clean-up. Perfect for use with the Poly-Ramp™ to make movement of drums a breeze. When not in use, simple snap and folds allow for storage virtually anywhere, freeing up valuable shelf and floor space. Save a bundle on shipping with manageable box and just minutes to set up!','','','',NULL,NULL,NULL,'N/A',NULL,'2011-05-19 16:47:12','2011-05-19 16:47:12',193);
